[[package]]
name = "aws-xray-sdk"
version = "2.8.0"
description = "The AWS X-Ray SDK for Python (the SDK) enables Python developers to record and emit information from within their applications to the AWS X-Ray service."
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
botocore = ">=1.11.3"
future = "*"
wrapt = "*"

